                $set: {
                    title,
                    description,
                },
            }

        );

        postController(req, res);
    } catch (error) {
        console.log(error);
        res.render("error");
    }
}

export const postDelete = async(req, res) => {
    const {
        body: { id },
    } = req;

    try {
        const result = await crud1.deleteOne({ _id: id });

        postController(req, res);
    } catch (error) {
        console.log(error);
        res.render("error");
    }
}

